import java.util.*;
public class EvenOdd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int x;
System.out.println("Enter the number");
Scanner in = new Scanner(System.in);
x = in.nextInt();
if (x%2==0)
{
	System.out.println("Even");
}
else
{
	System.out.println("Odd");
}
	}

}
